  function handleLogout(){
    localStorage.clear()
    props.history.push('/')
  }

  return (
    <Router>
      <ReactTooltip place="right" type="dark" effect="solid"/>
      <div>
        <nav className="sidenav sidenav-fixed menu-left corPadrao darken-4">
          <ul>
            <li>
