            </li>
            <li>
                <Link to="/evaluation" data-tip="Avaliações" data-place="right" data-effect="solid"><i class="large material-icons white-text">assignment</i></Link>
            </li>
            <li>
                <Link to="#Sair" onClick={handleLogout} data-tip="Sair" data-place="right" data-effect="solid"><i class="large material-icons white-text">logout</i></Link>
